void penult_layer::thread_ap_clk_no_reset_() {
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_CS_fsm = ap_ST_fsm_state1;
    } else {
        ap_CS_fsm = ap_NS_fsm.read();
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_done_reg = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, ap_continue.read())) {
            ap_done_reg = ap_const_logic_0;
        } else if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state6.read()) && 
                    esl_seteq<1,1,1>(ap_const_lv1_0, p_08_i_load_load_fu_218_p1.read()))) {
            ap_done_reg = ap_const_logic_1;
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        grp_pool_fu_149_ap_start_reg = ap_const_logic_0;
    } else {
        if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state3.read()) && 
             esl_seteq<1,1,1>(tmp_1_nbreadreq_fu_96_p3.read(), ap_const_lv1_1) && 
             esl_seteq<1,1,1>(ap_const_lv1_1, tmp_2_nbwritereq_fu_104_p3.read()))) {
            grp_pool_fu_149_ap_start_reg = ap_const_logic_1;
        } else if (esl_seteq<1,1,1>(ap_const_logic_1, grp_pool_fu_149_ap_ready.read())) {
            grp_pool_fu_149_ap_start_reg = ap_const_logic_0;
        }
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state6.read()) && 
         esl_seteq<1,1,1>(ap_const_lv1_1, p_08_i_load_load_fu_218_p1.read()))) {
        pingpang_flag_i_reg_137 = pingpang_flag_reg_260.read();
    } else if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && 
                !(esl_seteq<1,1,1>(ap_const_logic_0, ap_start.read()) || esl_seteq<1,1,1>(ap_done_reg.read(), ap_const_logic_1) || esl_seteq<1,1,1>(ap_const_logic_0, inputs_offset_empty_n.read()) || esl_seteq<1,1,1>(ap_const_logic_0, outputs_offset_empty_n.read())))) {
        pingpang_flag_i_reg_137 = ap_const_lv1_0;
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && !(esl_seteq<1,1,1>(ap_const_logic_0, ap_start.read()) || esl_seteq<1,1,1>(ap_done_reg.read(), ap_const_logic_1) || esl_seteq<1,1,1>(ap_const_logic_0, inputs_offset_empty_n.read()) || esl_seteq<1,1,1>(ap_const_logic_0, outputs_offset_empty_n.read())))) {
        inputs_offset1_i_reg_239 = inputs_offset_dout.read().range(31, 1);
        outputs_offset2_i_reg_234 = outputs_offset_dout.read().range(31, 1);
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state3.read()) && esl_seteq<1,1,1>(tmp_1_nbreadreq_fu_96_p3.read(), ap_const_lv1_1) && esl_seteq<1,1,1>(ap_const_lv1_1, tmp_2_nbwritereq_fu_104_p3.read()))) {
        pingpang_flag_reg_260 = pingpang_flag_fu_202_p2.read();
        tmp_4_i_reg_250 = tmp_4_i_fu_184_p3.read();
        tmp_6_i_reg_255 = tmp_6_i_fu_193_p3.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state5.read()) && esl_seteq<1,1,1>(ap_const_lv1_1, tmp_3_nbreadreq_fu_112_p3.read()))) {
        tmp_fu_76 =  (sc_lv<1>) (pre_ready_V_dout.read());
    }
}

